import { E2eSeed } from '#test/e2e/e2e-seed';
import { AdminUserRoles } from '#/sga/shared/domain/enum/admin-user-roles.enum';
import { DataSource, Repository } from 'typeorm';
import { BusinessUnit } from '#business-unit/domain/entity/business-unit.entity';
import { AdminUser } from '#admin-user/domain/entity/admin-user.entity';
import { getAnAdminUser } from '#test/entity-factory';
import { Country } from '#shared/domain/entity/country.entity';
import { getAnIdentityDocument } from '#test/value-object-factory';
import { createAdminUser } from '#test/e2e/sga/e2e-auth-helper';

export class RegisterAdminUserE2eSeed implements E2eSeed {
  public static newAdminId = '401ddba2-d710-460a-a34e-7e8a4eb1a438';
  public static newAdminEmail = 'newadmin@universae.com';
  public static newAdminPassword = 'pass123';
  public static newAdminName = 'new-admin';
  public static newAdminSurname = 'surname';
  public static newAdminSurname2 = 'surname2';
  public static newAdminAvatar =
    'data:image/png;base64,';

  public static newAdminRoles = [AdminUserRoles.SUPERADMIN];

  public static newAdminBusinessUnits = [
    '003951c0-ab04-48c0-bcf8-255e36fde23e',
  ];

  public static newIdentityDocument = getAnIdentityDocument().value;

  public static id = '35637f98-af93-456d-bde4-811ec48d4815';
  public static email = 'get-admin-user@email.com';
  public static password = 'pass123';
  public static role = AdminUserRoles.SUPERADMIN;

  private adminUser: AdminUser;

  private businessUnit: BusinessUnit;
  private createdAdminUser: AdminUser;

  private businessUnitRepository: Repository<BusinessUnit>;
  private userRepository: Repository<AdminUser>;
  private countryRepository: Repository<Country>;

  constructor(private datasource: DataSource) {
    this.businessUnitRepository = datasource.getRepository(BusinessUnit);
    this.userRepository = datasource.getRepository(AdminUser);
    this.countryRepository = datasource.getRepository(Country);
  }

  async arrange(): Promise<void> {
    this.createdAdminUser = getAnAdminUser();
    await this.userRepository.save(this.createdAdminUser);
    const country = (await this.countryRepository.findOne({
      where: { name: 'España' },
    })) as Country;
    this.businessUnit = BusinessUnit.create(
      RegisterAdminUserE2eSeed.newAdminBusinessUnits[0],
      'test',
      'test',
      country,
      this.createdAdminUser,
    );
    await this.businessUnitRepository.save(this.businessUnit);
    this.adminUser = await createAdminUser(
      this.datasource,
      RegisterAdminUserE2eSeed.id,
      RegisterAdminUserE2eSeed.email,
      RegisterAdminUserE2eSeed.password,
      [RegisterAdminUserE2eSeed.role],
    );
  }

  async clear(): Promise<void> {
    await this.businessUnitRepository.delete(this.businessUnit.id);
    await this.userRepository.delete(this.createdAdminUser.id);
    await this.userRepository.delete(RegisterAdminUserE2eSeed.newAdminId);
    await this.userRepository.delete(RegisterAdminUserE2eSeed.id);
  }
}
